import React from 'react';

function TestResultsDashboard({ summary = {} }) {
  const {
    total = 0,
    passed = 0,
    failed = 0,
    duration = '‚Äî',
    languageBreakdown = []
  } = summary;

  const passRate = total > 0 ? ((passed / total) * 100).toFixed(2) : '0.00';

  return (
    <div className="grid grid-cols-1 md:grid-cols-2 gap-6 p-6">
      {/* Test Summary Card */}
      <div className="bg-white rounded-2xl shadow-md p-6">
        <h2 className="text-2xl font-semibold mb-4 text-gray-800">üìä Test Summary</h2>
        <div className="space-y-3 text-lg text-gray-700">
          <div>‚úÖ <span className="font-medium">Total Tests Run:</span> {total}</div>
          <div>üü¢ <span className="font-medium">Passed:</span> {passed}</div>
          <div>üî¥ <span className="font-medium">Failed:</span> {failed}</div>
          <div>üìà <span className="font-medium">Pass Rate:</span> {passRate}%</div>
          <div>‚è±Ô∏è <span className="font-medium">Execution Time:</span> {duration}</div>
        </div>
      </div>

      {/* Test Breakdown by Language Card */}
      <div className="bg-white rounded-2xl shadow-md p-6">
        <h2 className="text-2xl font-semibold mb-4 text-gray-800">üß™ Test Breakdown by Language</h2>
        {languageBreakdown.length > 0 ? (
          <ul className="list-disc list-inside space-y-2 text-lg text-gray-700">
            {languageBreakdown.map((lang, idx) => (
              <li key={idx}>
                {lang.name}: {lang.total} tests, {lang.passRate}% pass
              </li>
            ))}
          </ul>
        ) : (
          <p className="text-gray-500 italic">No language breakdown available.</p>
        )}
      </div>
    </div>
  );
}

export default TestResultsDashboard;
